import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { setName, setSurname } from "../slices/userSlice";
import { Link } from "react-router-dom";
import logo from "../assets/imgs/BÇ.png";

function ProfilePage() {
  const user = useSelector((state) => state.user);
  const name = user.name;
  const surname = user.surname;

  const [tempName, setTempName] = useState(name);
  const [tempSurname, setTempSurname] = useState(surname);

  const dispatch = useDispatch();

  const handleClick = () => {
    dispatch(setName(tempName));
    dispatch(setSurname(tempSurname));
  };

  const handleLogout = () => {
    // Clear input fields and dispatch logout actions if needed
    setTempName("");
    setTempSurname("");
    // Additional logout logic if necessary
  };

  return (
    <div>
      <div className="headerUser">
        <a href="#default" className="logo">
          <img className="logoImg" src={logo} alt="logo" />
        </a>
        <div className="header-right">
          <Link to="/home">
            <button>Home</button>
          </Link>
          <Link to="/profile">
            <button>Profile</button>
          </Link>
          <Link to="/">
            <button onClick={handleLogout}>Log Out</button>
          </Link>
        </div>
      </div>

      <div>
        <h3>Profile Page</h3>
      </div>
      <div>
        <div className="inputArea">
          <div>
            <p className="text">Name:</p>
          </div>
          <div>
            <input
              className="input"
              value={tempName}
              onChange={(e) => setTempName(e.target.value)}
            />
          </div>
        </div>

        <div className="inputArea">
          <div>
            <p className="text">Surname:</p>
          </div>
          <div>
            <input
              className="input"
              value={tempSurname}
              onChange={(e) => setTempSurname(e.target.value)}
            />
          </div>
        </div>

        <div className="buttonTopArea">
          <div className="buttonArea">
            <Link to="/home">
              <button className="loginButton" onClick={handleClick}>
                Change
              </button>
            </Link>
            <Link to="/home">
              <button className="loginButton">Not Change</button>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProfilePage;
